import TransitionBtn from "../components/TransitionBtn.js"
import "../style/About.css"



function About() {

    return (
      <div className="section">
        <div className="About" id="About">
            <div className="textWrapperLeft">
              <h1 className="title" data-aos="zoom-in-right">ABOUT</h1>
              <p className="p1" data-aos="zoom-in-right">Ever feel like what you learn in the classroom is deeply theoretical, with little opportunities to build out practical applications?</p>
              <p className="p1" data-aos="zoom-in-right">DevX is a student organization dedicated to solving that very problem! We comprise of several project teams building out real-world projects to help tackle pressing problems frustrating the UCLA community. Make your ideas come to life, grow your technical skills by pairing up with experienced students, and build a network that lasts beyond graduation.</p>
            </div>
        </div>
        <TransitionBtn navUrl="Recruitment"/>
      </div>
    );    
  }
  export default About;
